  false,\n\t\"url\": null,\n\t\"notes\": \"The Special Sensor Microwave/Imager (SSM/I)
  and Special Sensor Microwave Imager-Sounder (SSMIS) have been making measurements
  of earth-emitted microwave radiation for over two decades. Antenna temperature data
  from these sensors are used to derive both atmospheric and surface hydrological
  parameters and to generate this time series of global monthly mean products. Specifically,
  this includes monthly estimates of precipitable water (wvp), liquid water path (lwp),
  rainfall (pr1), and snow cover in both color and black and white. This domain of
  the SSM/I and SSMIS archive includes images of data from January 2006 to the present.
  For a complete description of these products, please refer to documentation.\",\n\t\"owner_org\":
